window.bookSummaryJSON = "<p>Journey to <i>New York Times</i> best-selling author Meljean Brook's gritty, alluring world of the Iron Seas, and gear up for passionate steampunk adventure....</p> <p>As the mercenary captain of the <i>Lady Corsair</i>, Yasmeen has learned to keep her heart as cold as steel, her only loyalty bound to her ship and her crew. So when a man who once tried to seize her airship returns from the dead, Yasmeen will be damned if she gives him another opportunity to take control.</p> <p>Treasure-hunter Archimedes Fox isn’t interested in the <i>Lady Corsair</i> - he wants her coldhearted captain and the valuable da Vinci sketch she stole from him. To reclaim it, Archimedes is determined to seduce the stubborn woman who once tossed him to a ravenous pack of zombies, but she’s no easy conquest.</p> <p>When da Vinci’s sketch attracts a dangerous amount of attention, Yasmeen and Archimedes journey to Horde-occupied Morocco - and straight into their enemy’s hands. But as they fight to save themselves and a city on the brink of rebellion, the greatest peril Yasmeen faces is from the man who seeks to melt her icy heart....</p>"; 
